import { useState } from "react";
import { useEffect } from 'react';

function Home() {
    const [accounts, setAccounts] = useState([]);

    useEffect(() => {
        fetch("/a-service/v1/accounts/getAllAccount/1")
            .then(res => res.json())
            .then(
                (result) => {
                    setAccounts(result)
                },
                (error) => {
                    console.log(error)
                }
            )
    }, [])
    return (
        <div>
            <table class="table">
                <thead class="thead-dark">
                    <tr>
                        <th scope="col">#</th>
                        <th scope="col">Account</th>
                        <th scope="col">Balance</th>
                    </tr>
                </thead>
                <tbody>
                    {accounts.map(account =>
                        <tr>
                            <th>{account.id}</th>
                            <td>{account.accountType}</td>
                            <td>{account.balance}</td>
                            <button className='btn btn-primary'>Transactions</button>
                        </tr>
                    )
                    }
                </tbody>
            </table>
            <div>
            <button class="btn btn-primary" type="button" data-bs-toggle="offcanvas" data-bs-target="#offcanvasScrolling" aria-controls="offcanvasScrolling">Enable body scrolling</button>

            <div class="offcanvas offcanvas-start" data-bs-scroll="false" data-bs-backdrop="false" tabindex="-1" id="offcanvasScrolling" aria-labelledby="offcanvasScrollingLabel">
                <div class="offcanvas-header">
                    <h5 class="offcanvas-title" id="offcanvasScrollingLabel">Offcanvas with body scrolling</h5>
                    <button type="button" class="btn-close" data-bs-dismiss="offcanvas" aria-label="Close"></button>
                </div>
                <div class="offcanvas-body">
                    <p>Try scrolling the rest of the page to see this option in action.</p>
                </div>
            </div>
            </div>
        </div>
    );
}
export default Home;
